Q & A

Q. How to set a invite code?
A. Use _G.DiscordInvCode_PrivateMethod = "Invite Code"

Q. What is a invite code?
A. A invite code is the code you got from the invite link E.G: https://discord.com/ABC123 the invite code will be ABC123

Q. What is the default invite code?
A. The default invite code is nill so that means it won't do anything.

Q. Is this open source?
A. Unfortunately it's not.

Q. Why it doesn't work?
A. The possible reason is that you didn't open the discord app or the invite code is nill.

